import React from 'react';
import SideDrawerButton from '../Toolbar/siderDrawerButton';

const toolbar = props => (
    <>
        <div className="toolbar">
            <nav className="toolbar_navigation">
                <SideDrawerButton />
            </nav>
        </div>
    </>
);

export default toolbar;
